import React, { useState } from 'react';
import axios from 'axios';

const Form = ({ onPrediction }) => {
  const [formData, setFormData] = useState({
    flightNumber: '',
    airlineCode: '',
    originAirport: '',
    destinationAirport: '',
    departureDate: '',
    depTimeMinutes: '',
    duration: '',
    CRSArrTimeMinutes: '',
    taxiIn: 0,
    taxiOut: 0,
    carrierDelay: 0,
    weatherDelay: 0,
    NASDelay: 0,
    lateAircraftDelay: 0,
  });

  const [error, setError] = useState('');

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('http://localhost:8000/predict', formData);
      onPrediction(response.data);
    } catch (err) {
      setError('Error processing prediction. Please try again.');
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      <h2>Flight Delay Prediction</h2>
      {error && <p style={{ color: 'red' }}>{error}</p>}
      
      <input name="flightNumber" placeholder="Flight Number" onChange={handleChange} required />
      <input name="airlineCode" placeholder="Airline Code" onChange={handleChange} required />
      <input name="originAirport" placeholder="Origin Airport Code" onChange={handleChange} required />
      <input name="destinationAirport" placeholder="Destination Airport Code" onChange={handleChange} required />
      
      <input type="date" name="departureDate" onChange={handleChange} required />
      <input name="depTimeMinutes" type="number" placeholder="Departure Time (Minutes)" onChange={handleChange} required />
      <input name="duration" type="number" placeholder="Scheduled Flight Duration (Minutes)" onChange={handleChange} required />
      <input name="CRSArrTimeMinutes" type="number" placeholder="Scheduled Arrival Time (Minutes)" onChange={handleChange} required />
      
      <input name="taxiIn" type="number" placeholder="Taxi In Time (Minutes)" onChange={handleChange} />
      <input name="taxiOut" type="number" placeholder="Taxi Out Time (Minutes)" onChange={handleChange} />
      <input name="carrierDelay" type="number" placeholder="Carrier Delay (Minutes)" onChange={handleChange} />
      <input name="weatherDelay" type="number" placeholder="Weather Delay (Minutes)" onChange={handleChange} />
      <input name="NASDelay" type="number" placeholder="NAS Delay (Minutes)" onChange={handleChange} />
      <input name="lateAircraftDelay" type="number" placeholder="Late Aircraft Delay (Minutes)" onChange={handleChange} />

      <button type="submit">Predict</button>
    </form>
  );
};

export default Form;
